import { Route, Navigate, Outlet } from 'react-router-dom'

const useAuth = () => {
    const user = { loggeIn: false };
    return user && user.loggeIn;
};

const ProtectedRoute = ({children, ...rest}) => {
    return (
        <Route {...rest}>{children}</Route>
    )
}

export default ProtectedRoute
